import React from 'react';
import './App.css';
import Title from './components/title';
import Form from './components/form';
import Results from './components/results';

export default class App extends React.Component {
    render() {
        return (
            <div className="App">
              <Title/>
              <Form/>
              <Result/>
            </div>
        );
    }
}
